#!/usr/bin/env python3
#create an empty dict
nt_count = {}

#define dna and make into set for unique characters
dna = ''
dna_set = set(dna)
sum1 = len(dna_set)
print(sum1)

#count each nt and store in dict
for nt in dna_set:
    count = dna.count(nt)
    nt_count[nt] = count
print(nt_count)

#calc GC content
G_count = nt_count['G']
C_count = nt_count['C']
total_nt = len(dna)
GC_content = (G_count + C_count)/total_nt
print(f'GC content: {GC_content:.1%}')